// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RealEstate {
    uint256 public nextId = 1;
    
    // Add this explicit constructor
    constructor() payable {} 

    struct Property {
        uint256 id;
        address owner;
        string location;
        uint256 price;
        bool isSold;
        string documentHash;
    }

    mapping(uint256 => Property) public properties;
    mapping(uint256 => address[]) public ownershipHistory;

    event PropertyCreated(uint256 id, address indexed owner, string location, uint256 price);
    event PropertyTransferred(uint256 id, address indexed from, address indexed to, uint256 price);

    function createProperty(string memory _location, uint256 _price, string memory _documentHash) public {
        properties[nextId] = Property(nextId, msg.sender, _location, _price, false, _documentHash);
        ownershipHistory[nextId].push(msg.sender);
        emit PropertyCreated(nextId, msg.sender, _location, _price);
        nextId++;
    }

    function transferProperty(uint256 _id, address _to) public {
        Property storage property = properties[_id];
        require(property.owner == msg.sender, "Not owner");
        require(!property.isSold, "Already sold");
        require(_to != address(0), "Invalid address");

        property.owner = _to;
        property.isSold = true;
        ownershipHistory[_id].push(_to);

        emit PropertyTransferred(_id, msg.sender, _to, property.price);
    }

    function getPropertyBasic(uint256 _id) public view returns (
        uint256 id,
        address owner,
        string memory location,
        uint256 price,
        bool isSold
    ) {
        Property storage prop = properties[_id];
        return (prop.id, prop.owner, prop.location, prop.price, prop.isSold);
    }

    function getPropertyDetails(uint256 _id) public view returns (
        string memory documentHash,
        address[] memory ownersHistory
    ) {
        return (properties[_id].documentHash, ownershipHistory[_id]);
    }
}
